import { Header } from "../components/molecules/header/header";

const { Icon } = require("../components/atoms/icon/icon");

function Index() {
  return (
    <div>
      <Header>
        <Icon img="/icon-menu.svg" alt="menu-bar" link="#"></Icon>
      </Header>
    </div>
  );
}

export default Index;
